import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header>
    <div class="logo">
        <img src="your-logo.png" alt="Logo" />
    </div>
    <nav>
        <a href="#">Home</a>
        <a href="#">About</a>
        <a href="#">Services</a>
        <a href="#">Contact</a>
    </nav>
</header>
    </div>
  );
}

export default App;
